ShieldStart:
[[Exec sudo taskset -cp 0-2 $(pidof printer)]]
[[Blank]]
[[MoveCounterSet 0]]
INITIALIZE_LEDS EN_FSS_STATE=1 EN_PROGRESS=1
UVLED_CALIBRATION uvled_calib_val=[[_UVLedCalibration]]
SET_FIRST_BAR R=0 G=0 B=1
TRIGGER
HOME_AXIS ;Home Z
[[MoveWait 1]]
[[PressureWrite 1]]
[[PositionSet 245]]
G90 ;Absolute Positioning
[[GPIOHigh 10]]

[JS]
if( [[_FssEnableCrashdetection]]==0){ 
	output="[[CrashDetectionStart]]";
	output+="\n";
	output+="ATHENA_PROBE_DOWNWARDS Z=240 F=480";
	output+="\n";
	output+="ATHENA_PROBE_DOWNWARDS Z=4 F=10";
	output+="\n";
}else{
	output="[[MoveCounterSet 2]]";
	output+="\n";
	output+="MOVE_PLATE Z=35 F=600";

}
[/JS]
[[MoveWait 3]]

DWELL P=2000
[[MoveWait 4]]

[[CrashDetectionStop]]

MOVE_PLATE Z=35 F=100
[[MoveWait 5]]

[[PressureWrite 1]]
[JS]
if( [[_FssEnableResinleveldetection]]==0){ 
	output="[[ResinLevelDetectionStart]]";
	output+="\n";
	output+="ATHENA_PROBE_RESINLEVEL Z=34 F=100";
	output+="\n";
}else{
	output="[[MoveCounterSet 6]]";
}
[/JS]
[[MoveWait 6]]

[[ResinLevelDetectionStop]]
[[Delay 1]]
[[Split]]


[JS]
if ( [[ResinAmountAfterPrint]] < 0 && [[_FssEnableResinleveldetection]] != 1){
 output="[[Notification warning 0 Amount of Resin in the tank might not be sufficient]]";
 output+="\n";
 output+="[[Pause]]";
}
[/JS]

[JS]
	if ([[_HeaterEnable]] == 0 && [[_ResinPreheatTemperature]]!=0) output="SET_AND_WAIT_RESIN_HEATER TARGET=[[_ResinPreheatTemperature]]";
[/JS]

[[PressureWrite 1]]

DWELL P=2000
[[MoveWait 7]]

[[MoveCounterSet 1]]

ShieldFinish:
UVLED_OFF
[[Blank]]
SET_FIRST_BAR R=0.5 G=0.3 B=0
[[MoveCounterSet 0]]
[JS]
if([[CurrentPosition]]<200){
output= "G91 ;Relative Position"
output+="\n"
output+="MOVE_PLATE Z=45 F=600";
output+="\n"
output+="[[PositionChange 45]]"
} else {
output="G90 ;Absolute Position";
output+="\n";
output+="MOVE_PLATE Z=245 F=600";
output+="\n";
output+="[[PositionSet 245]]"
}
[/JS]
[[MoveWait 1]]
TRIGGER
DWELL P=1000
[[MoveWait 2]]
TRIGGER
SET_FIRST_BAR R=0 G=1 B=0
SET_RESIN_HEATER TARGET=0
SET_FAN_SPEED FAN=ptc_fan SPEED=0
DWELL P=2000
[[MoveWait 3]]
[[Exec sudo taskset -cp 0-3 $(pidof printer)]]
